import React, { useState } from 'react';

const WorkspaceCreationPage = () => {
    const [workspaceData, setWorkspaceData] = useState({
        name: '',
        description: '',
        // Add more fields as needed
    });

    const handleInputChange = (event) => {
        const { name, value } = event.target;
        setWorkspaceData((prevState) => ({
            ...prevState,
            [name]: value,
        }));
    };

    const handleSubmit = async (event) => {
        event.preventDefault();

        try {
            const response = await fetch('/api/workspaces', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(workspaceData),
            });

            if (response.ok) {
                // Workspace creation successful
                console.log('Workspace created!');
            } else {
                // Handle workspace creation error
                console.error('Error creating workspace');
            }
        } catch (error) {
            console.error('Error creating workspace:', error);
        }
    };

    return (
        <div>
            <h2>Create Workspace</h2>
            <form onSubmit={handleSubmit}>
                <div>
                    <label htmlFor="name">Name:</label>
                    <input
                        type="text"
                        id="name"
                        name="name"
                        value={workspaceData.name}
                        onChange={handleInputChange}
                    />
                </div>
                <div>
                    <label htmlFor="description">Description:</label>
                    <textarea
                        id="description"
                        name="description"
                        value={workspaceData.description}
                        onChange={handleInputChange}
                    ></textarea>
                </div>
                {/* Add more input fields for other workspace details */}
                <button type="submit" variant={"contained"}>Create Workspace</button>
            </form>
        </div>
    );
};

export default WorkspaceCreationPage;
